import logo from './logo.svg';
import './App.css';
import React from 'react';

class Testing extends React.Component {
  render() {
    return <h2>Hi, I am a dddd!</h2>;
    <div class='header'>
      <div class="logo">
        <h2>Digitzen</h2>
      </div>
      <div class="menu">
        <p class="default_text">Our products</p>
        <p class="default_text">Contacts</p>
        <p class="default_text">Login or Register</p>
        <div class="shopping_cart">
          <img src="source/buy.svg" alt="Shopping cart"></img>
          <div class="items_in_cart">
            <div class='default_text counter_items_in_cart'>
              <div id='i'>i</div>
            </div>
          </div>
        </div>
      </div>
    </div>
  }
}

export default Testing;
